def replace_none_with_dash(data):
    if isinstance(data, list):
        return [replace_none_with_dash(item) for item in data]
    elif isinstance(data, dict):
        return {k: replace_none_with_dash(v) for k, v in data.items()}
    else:
        return '-' if data is None else data


def generator_doc(data, template_path, save_path):
    data = replace_none_with_dash(data)
    doc = DocxTemplate(template_path)

    # 根据模版 构造待渲染的数据结构
    context = {}
    # rating_results  内评结果 and 主要财务指标
    context['rating_results'] = data['rating_results']

    # 资产质量 和 公司资产构成情况
    context['assets_quality'] = data['assets_quality']

    # 资本结构  和  公司负债构成情况（单位：亿元）
    context['capital_structure'] = data['capital_structure']

    # 盈利能力  和  公司收入及盈利情况
    context['profitability'] = data['profitability']

    # 现金流  和 公司现金流情况
    context['cashflow'] = data['cashflow']

    # 偿债能力  和 公司偿债能力指标
    context['debt_paying_ability'] = data['debt_paying_ability']

    # company_related 主体基本信息、企业存续债、历史主体评级
    context['company_related'] = data['company_related']
    context['company_related']['left_table_2'] = context['company_related']['left_table_2'][1:]  # 不要第一行数据
    context['company_related']['right_table_data'] = context['company_related']['right_table_data'][1:]

    doc.render(context, jinja2.Environment(autoescape=True))

    doc.save(save_path)


